public class tableoften {

	/**
	 * @param args
	 */
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		System.out.println("Table of 10"+"\n");
		for (int i=1;i<20;i++)
		{
			System.out.println("10"+"*"+i+"="+10*i);
		}
	}
}
